import React from 'react';
import { IonHeader, IonToolbar, IonTitle, IonContent } from '@ionic/react';

import Typed from 'react-typed';

import './index.css';

class Main extends React.Component {

 componentDidMount() {
  scanForDevices.thisIsAFunction();
 }

  render() {
    return (
      <IonContent class="main_page">
        <IonHeader class="main-header">
          <IonToolbar class="main-toolbar">
            <IonTitle class="main-toolbar-title" size="large">Looking for devices...</IonTitle>
          </IonToolbar>
        </IonHeader>
        <Typed
          strings={['Here you can find anything']}
          typeSpeed={40}
          />
          <br/>

          <Typed
          strings={[
            'Search for products',
            'Search for categories',
            'Search for brands']}
            typeSpeed={40}
            backSpeed={50}
            attr="placeholder"
            loop >
            <input type="text"/>
          </Typed>
      </IonContent>
    );
  };
};

class scanForDevices {
  static thisIsAFunction() {
    console.log("loaded!1");
   }
}


export default Main;
